const DemoStyle = (props) => {
  const Container = styled.div`
    color: red;
    heigth: props => props.minHeigth ? 100px : 500Px;
  `;

  return (
    <div className="container">
      <h1>Demo Style</h1>
    </div>
  );
};

export default DemoStyle;
